import React from 'react';
import Logo from './Logo';
import {Link} from 'react-router-dom';

function Header(){
  return(
    <div className="Header">
      <h1> Reconnect </h1>
      <Logo />
      <Link>Sign In</Link>
      <Link>Sign Up</Link>
    </div>
  )
}

export default Header;
